type ColorInputType = { hex: string } | { hex: string[] };
type TextInputType = { value: string };
type ImageInputType = { blob: Blob } | { url: string };

// type EditorInputType = COLOR_INPUT_TYPE | TEXT_INPUT_TYPE | IMAGE_INPUT_TYPE;

enum EditorInputType {
	COLOR_INPUT,
	TEXT_INPUT,
	IMAGE_INPUT,
}

interface Transaction {
	id: string;
	userId: string;
	amount: number;
	method: string; //PAYPAL, STRIPE, BTC
	createdAt: Date;
	updatedAt: Date;
}

interface ProductTransaction extends Transaction {
	productId: string;
	duration: number; //milliseconds
}

interface PlanTransaction extends Transaction {
	planId: string;
	duration: number; //milliseconds
}

interface User {
	id: string;
	email: string;
	password: string; //tbd, might not use
	discord: {
		email: string;
		linked: Date;
	};
	productPurchases: ProductTransaction[]; //product id
	planPurchases: PlanTransaction[]; //plan id
	createdAt: Date;
	updatedAt: Date;
}

export default EditorInputType;
export type { ColorInputType, TextInputType, ImageInputType };

